#!/usr/bin/python3
class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        result = []
        n = len(numbers)
        i = 0
        j = n - 1
        while i < j:
            tempSum = numbers[i] + numbers[j]
            if   tempSum == target:
                result.append(i+1)
                result.append(j+1)
                return result
            elif tempSum < target:
                i += 1
            else:
                j -= 1
        return result

solver = Solution()
